import "react-native-gesture-handler";
import React, { useEffect, useState } from 'react';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { ActivityIndicator, FlatList, Dimensions, StyleSheet, SafeAreaView, StatusBar, View, Button, Image, ScrollView, Text, TextInput, ImageBackground, TouchableOpacity } from "react-native";

const Stack = createStackNavigator();
const THEME_COLOR = "#2081D0";

var email = "elonmusk@gmail.com";
var password = "IownTesla";
var registeryinput = "registeryinput";
var editinput = "editinput";
var { height, width } = Dimensions.get("window");

const App = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                {/* add headerleft : null back in after prototyping is done */}
                <Stack.Screen
                    name="LoginSelection"
                    component={LoginSelectionScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="ALogin"
                    component={ALoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="CLogin"
                    component={CLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="DMLogin"
                    component={DMLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="DMCLogin"
                    component={DMCLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="ECCLogin"
                    component={ECCLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="AHome"
                    component={AHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="CHome"
                    component={CHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="DMHome"
                    component={DMHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="DMCHome"
                    component={DMCHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="ECCHome"
                    component={ECCHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="CRegister"
                    component={CRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="DMRegister"
                    component={DMRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="DMCRegister"
                    component={DMCRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
				<Stack.Screen
                    name="ECCRegister"
                    component={ECCRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="RegisterSuccess"
                    component={RegisterSuccessScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="EditProfile"
                    component={EditProfileScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="EditPassword"
                    component={EditPasswordScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="ChangePassword"
                    component={ChangePasswordScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="OrderList"
                    component={OrderListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="OrderDetails"
                    component={OrderDetailsScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="PlaceOrder"
                    component={PlaceOrderScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="OrderPlaced"
                    component={OrderPlacedScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="ConfirmOrder"
                    component={ConfirmOrderScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="OrderConfirmed"
                    component={OrderConfirmedScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
                <Stack.Screen
                    name="Help"
                    component={HelpScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }, headerBackTitleVisible: false }}
                />
            </Stack.Navigator>
        </NavigationContainer>
    );
};

const styles = StyleSheet.create({
	bgcolor: {
		backgroundColor: "#ffffff"
	},
	
    centerxy: {
        justifyContent: "center",
        alignItems: "center",
    },

    centerallxy: {
        justifyContent: "center",
        alignItems: "center",
        flex: 1,
    },

    RegisterSuccess: {
        justifyContent: "center",
        alignItems: "center",
        flex: 1,
        backgroundColor: THEME_COLOR,
    },

    margin: {
        marginLeft: "5%",
    },

    datemargin: {
        marginLeft: "7%",
		alignItems: 'flex-start'
    },

    margintop: {
        marginTop: "5%",
    },

    listonlymargintop: {
        marginTop: "10%",
        marginLeft: "3%",
    },

    listonlymargin: {
        marginTop: "5%",
        marginLeft: "3%",
    },

    listline: {
        backgroundColor: "#CDCDCD",
        height: 3,
        marginTop: "2%",
        marginBottom: "2%",
    },
	
	listlineblue: {
        backgroundColor: THEME_COLOR,
        height: 3,
        marginTop: "2%",
        marginBottom: "2%",
    },

    mediumicon: {
        width: 120,
        height: 120,
        marginTop: "10%",
        marginBottom: "5%",
    },

    smallicon: {
        width: 50,
        height: 50,
        marginRight: 15,
    },

    listitems: {
        flexDirection: "row",
        justifyContent: "space-between",
        marginLeft: "3%",
    },

    listitemsonly: {
        marginTop: "5%",
    },

    listitemsrow: {
        flexDirection: "row",
    },

    listitemscolumn: {
        flexDirection: "column",
    },

    listtext: {
        alignItems: "flex-start",
        justifyContent: "center",
    },

    listiconright: {
        alignItems: "flex-end",
    },

    listiconleft: {
        alignItems: "flex-start",
        marginTop: "5%",
        marginLeft: "5%",
    },

    mainpp: {
        width: 250,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
    },
	
	aprofileimage: {
		width: 355,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},
	
	cprofileimage: {
		width: 361,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},
	
	dmprofileimage: {
		width: 336,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},
	
	dmcprofileimage: {
		width: 392,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},
	
	eccprofileimage: {
		width: 350,
        height: 250,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},
	
	logoimage: {
		width: 399,
        height: 225,
        marginTop: "10%",
        marginBottom: "10%",
		borderWidth: 2,
		borderColor: THEME_COLOR,
		borderRadius: 5,
	},

    h1: {
        fontSize: 25,
        marginBottom: "5%",
    },

    h2: {
        fontSize: 20,
        marginBottom: "5%",
    },
	
	h3: {
		color: THEME_COLOR,
        fontSize: 25,
	},

    button: {
        width: 250,
        justifyContent: "center",
        padding: 5,
        margin: 5,
    },
	
	buttontext: {
		color: 'white'
	},

    buttonleft: {
        alignItems: "flex-start",
        marginLeft: "4%",
    },

    inputtext: {
        borderBottomWidth: 1,
        borderColor: THEME_COLOR,
        padding: 5,
        margin: 5,
        width: "90%",
        borderRadius: 10,
    },
	
	buttonfont: {
		color: "#FFFFFF",
        fontSize: 15,
		textTransform: "uppercase",
		paddingLeft: 15,
		paddingTop: 15,
	},
	
	listfont: {
		color: "#FFFFFF",
        fontSize: 15,
		paddingLeft: 15,
		paddingTop: 5,
	},
	
	buttonview: {
		borderRadius: 10,
		marginLeft: 10,
		marginRight: 10,
		marginTop: 5,
		marginBottom: 5,
		padding: 10,
		backgroundColor: THEME_COLOR,
		flexDirection: "row",
		justifyContent: "space-between"
	},
});

const LoginSelectionScreen = ({ navigation }) => {
	return (
	<ScrollView style={ styles.bgcolor }>	
			<View style={styles.centerallxy}>
				<Image style={styles.logoimage} source={require("./assets/logo.png")}></Image>
				<Text style={styles.h3}>Select a User Type</Text>
				<Text>{"\n"}</Text>
				<View style={styles.button}><Button style={styles.button} title="Admin" onPress={() => navigation.navigate("ALogin")} /></View>
				<View style={styles.button}><Button style={styles.button} title="Customer" onPress={() => navigation.navigate("CLogin")} /></View>
				<View style={styles.button}><Button style={styles.button} title="Delivery Man" onPress={() => navigation.navigate("DMLogin")} /></View>
				<View style={styles.button}><Button style={styles.button} title="Delivery Men Company" onPress={() => navigation.navigate("DMCLogin")} /></View>
				<View style={styles.button}><Button style={styles.button} title="E-Commerce Company" onPress={() => navigation.navigate("ECCLogin")} /></View>
			</View>
	</ScrollView>
	);
};

const ALoginScreen = ({ navigation }) => {
    return (
	<ScrollView style={ styles.bgcolor }>	
            <View style={styles.centerallxy}>
                <Image style={styles.aprofileimage} source={require("./assets/aprofile.png")}></Image>
				<Text style={styles.h3}>Admin Login</Text>
				<Text>{"\n"}</Text>
				<TextInput style={styles.inputtext} placeholder="Email" onChangeText={(val) => (email = val)}></TextInput>
                <TextInput secureTextEntry={true} placeholder="Password" style={styles.inputtext} onChangeText={(val) => (password = val)}></TextInput>
				<Text>{"\n"}</Text>
				<View style={styles.button}>
                    <Button title="Login" onPress={() => navigation.navigate("AHome")} />
                </View>
            </View>
	</ScrollView>
    );
};

const CLoginScreen = ({ navigation }) => {
    return (
	<ScrollView style={ styles.bgcolor }>	
            <View style={styles.centerallxy}>
                <Image style={styles.cprofileimage} source={require("./assets/cprofile.png")}></Image>
				<Text style={styles.h3}>Customer Login</Text>
				<Text>{"\n"}</Text>
